import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import MenuInObject from './MenuInObject';
const Object = () => {
    return (
        <div className="Menu">
            <Router>
                <div>
                    {/* Навигация */}
                    <MenuInObject />
                    {/* Маршруты */}
                    {/*<Routes>
                        <Route path="/NewObjects" element={<NewObject />} />
                    </Routes>*/}
                </div>
            </Router>
        </div>
    );
};

export default Object;
